    <div>
      <div>
        <img
          src="https://unsplash.com/photos/JeakE5SZCug/download"
          alt="profile"
        />
      </div>
      <div>
        <h2>Orandi</h2>
        <h4>Age 58</h4>
        <h4>Rongai</h4>
      </div>
    </div>
  );
}

export default ProfileCard;
